commits.content:
.result {
  display: flex;
  justify-content: center;
  align-items: center;
}

.result img {
  max-width: 100%;
  max-height: 300px;
  border: 2px solid #000;
}

.artist-info {
  display: flex;
  flex-direction: column;
  align-items: center;
}

.artist-image {
  max-width: 100%;
  height: auto;
  border-radius: 8px;
  margin-bottom: 16px;
}

iframe {
  border: none;
  width: 100%;
  max-width: 400px;
  height: 120px;
}
